&lt;script&gt;
    $(document).ready(function() {
        $(&#039;#deleteForm&#039;).on(&#039;submit&#039;, function(e) {
            event.preventDefault(); // Mencegah reload form

            var form = $(this);
            var actionUrl = form.attr(&#039;action&#039;);

            $.ajax({
                url: actionUrl,
                type: &#039;POST&#039;,
                data: form.serialize(),
                success: function(response) {
                    $(&#039;#confirmDeleteModal&#039;).modal(&#039;hide&#039;);

                    // Tampilkan alert sukses (opsional)
                    Swal.fire({
                        icon: &#039;success&#039;,
                        title: &#039;Berhasil&#039;,
                        text: &#039;Data berhasil dihapus!&#039;,
                        timer: 2000,
                        showConfirmButton: false
                    });

                    // Reload data tabel (panggil ulang filter)
                    $(&#039;#filter-form&#039;).trigger(&#039;submit&#039;);
                },
                error: function(xhr, status, error) {
                    $(&#039;#confirmDeleteModal&#039;).modal(&#039;hide&#039;);
                    Swal.fire({
                        icon: &#039;error&#039;,
                        title: &#039;Gagal!&#039;,
                        text: &#039;Terjadi kesalahan saat menghapus data.&#039;,
                    });
                }
            });
        });

        $(&#039;#confirmDeleteModal&#039;).on(&#039;show.bs.modal&#039;, function(event) {
            var button = $(event.relatedTarget); // Tombol yang ditekan
            var id = button.data(&#039;id&#039;); // Ambil ID dari data-id
            var form = $(&#039;#deleteForm&#039;);

            // Ganti action URL form berdasarkan ID
            form.attr(&#039;action&#039;, &#039;https://sipro.pu.go.id/keterpaduanprogram/deleteusulan/&#039; + id);
        });


        var defaultProvinsi = &quot;34&quot;;
        var defaultUnor = &quot;0&quot;;
